import "./menu.scss";
import React from "react";
import useToken from "../useToken"

function Menu({ menuOpen, setMenuOpen }) {

  return (
    <div className={"menu " + (menuOpen && "active")}>
      <ul className={"menulist"}>
          <li onClick={() => setMenuOpen(false)}>
              <a href="#intro">Home</a>
          </li>
          <li onClick={() => setMenuOpen(false)}>
              <a href="#portfolio">IoT Devices</a>
          </li>
          <li onClick={() => setMenuOpen(false)}>
              <a href="#works">Technologies</a>
          </li>
          <li onClick={() => setMenuOpen(false)}>
              <a href="#bpmn">Bpmn Modeler</a>
          </li>
          <li onClick={() => {setMenuOpen(false); localStorage.removeItem('accessToken');
          }}>
              Logout
          </li>
      </ul>
    </div>
  );
}

export default Menu;
